### Instruction:
In javascript output the values in a dictionary sorted by key alphabetically.

### Response:

let dict = { "a": 1, "b": 2, "c": 3 };

// Sorting the keys of an object by alphabetical order
dict_sorted = {};
for (key in dict) {
    if (!dict.hasOwnProperty(key)) continue;
    dict_sorted[dict[key]] = key;
}
console.log(dict_sorted);
